#Leetcode.num = 136

'''
Given a non-empty array of integers, every element appears twice except for one. Find that single one.
Note:
Your algorithm should have a linear runtime complexity. Could you implement it without using extra memory?

Example 1:
Input: [2,2,1]
Output: 1
'''
'''
这两个solution都timeout了，但是删除重复数字的两行代码值得学习！
'''
'''
#肖哥的方法：recursion version。
'''
def single_num_recursion(nums):

    if len(nums) == 0:
        return 0
    if len(nums) == 1:
        return nums[0]
    try:
        nums.pop(nums.index(nums[0], 1, len(nums))) #index方法可以查询元素还否在列表中，不在的话会报异常
    except ValueError:
        return nums[0]
    nums.pop(0)
    return single_num_recursion(nums)

